import React, { Component } from 'react'
import NewsItem from './NewsItem'

export class News extends Component {
  render() {
    return (
      <div>
        <h5>this is news component</h5>
        <NewsItem title="Cricket" description="Dhoni is the best player nowadays."/>
        <NewsItem/>
        <NewsItem/>
      </div>
    )
  }
}

export default News
